    false,nt"url": null,nt"notes": "This annual narrative report for Mackay
    Island and Currituck National Wildlife Refuges outlines Refuge accomplishments during
    the 1995 calendar year.  The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses compliance with environmental and cultural resource mandates.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, fire management, and pest control.
    The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    animal control, and marking and banding. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about rehabilitation,
    major maintenance, and equipment replacement. Cooperative programs and items of
    interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
